(1353, 9, 'Montre (2ème choix)', 'Je préfère celle ci à la précédente, mais elle est bien plus chère. Mon premier choix serait de faire réparer la montre en or YEMA de Papy malheureusement il faut un horloger spécialisé car un des engrenages est abîmé', 'https://cdn.shopify.com/s/files/1/1199/1804/products/yonger-bresson-automatique-commercy-ybh-8373-43-25319699911.jpg?v=1490705044', 'https://yonger-bresson.fr/collections/montres-automatiques-homme-bracelet-cuir/products/ybh-8373-43', 600.00, 'EUR', 1, NULL, 0, NULL, 2017, NOW(), NOW()),
